INSERT INTO `catalog_pages` VALUES ('301', '-1', 'Wired', '10', '80', '1', '1', '1', '0', '0', '3', 'pets2', 'catalog_wired_header1', 'ctlg_pic_teaser_wired', '', 'Os Mobis Wired dar-lhe possibilidades quase infinitas!!!\r\n', '', 'Cómo funcionan?', 'Para obter uma completa Mobis Wired precisa de tres tipos.\r\n\r\n1. Ativadores: Coisas que você precisa fazer para ter um efeito em seu lugar.\r\n2. Efeitos: O que acontece quando você ativou uma causa.\r\n3. Condiçoes (opcional): Condiçoes que devem ocorrer antes que a causa e lançado.\r\n\r\nCon todo: Causante+Efecto+Condición=Wired', '0', '', '', '');
INSERT INTO `catalog_pages` VALUES ('302', '301', 'Ativadores', '1', '81', '1', '1', '1', '0', '0', '1', 'default_3x3', 'catalog_wired_header2_es', 'ctlg_pic_wired_triggers', '', 'Os Ativadores permitem que voce defina o que precisa acontecer para ocorrer um efeito. Para agendar um culpado, coloca-lo em uma sala, basta clicar duas vezes-lo e coloca-lo. Necessidade de uma pilha em um Efeito Ativador.', '', 'Clique em cada objeto para ver como funciona!', '', '0', '', '', '');
INSERT INTO `catalog_pages` VALUES ('303', '301', 'Efeitos', '1', '82', '1', '1', '1', '0', '0', '2', 'default_3x3', 'catalog_wired_header3_es', 'ctlg_pic_wired_effects', '', 'Los Efectos son lo que sucede después de haber activado un Causante. Para programar un Efecto, colócalo en una Sala, haz doble clic en él y ponlo en marcha. Necesitarás siempre apilar un Causante sobre un Efecto.', '', '¡Haz clic en cada objeto para ver lo que hace cada Efecto!', '', '0', '', '', '');
INSERT INTO `catalog_pages` VALUES ('304', '301', 'Condições', '1', '83', '1', '1', '1', '0', '0', '3', 'default_3x3', 'catalog_wired_header4_es', 'ctlg_pic_wired_conditions', '', 'Las Condiciones son determinados criterios que deben ser especificados antes de que el Causante se ponga en marcha. Si quieres usar una Condición, deberás apilarla sobre un Causante y un Efecto.', '', '¡Haz clic en cada objeto para ver cómo funcionan las Condiciones!', '', '0', '', '', '');
INSERT INTO `catalog_pages` VALUES ('305', '301', 'Extras', '1', '85', '1', '1', '1', '0', '0', '4', 'default_3x3', 'catalog_wired_header5_es', 'ctlg_pic_wired_support_furniture', '', 'Utiliza estos Furni simplemente para dar algo más de sabor a tu Sala Wired. Necesitarás apilar un Complemento sobre un Causante, un Efecto y una Condición para que funcione.', '', '¡Haz clic en cada objeto para ver de qué van los Complementos!', '', '0', '', '', '');
