INSERT INTO `moderation_forum_replies` VALUES ('5', '4', 'NothinG', '26 March 2011 10:41 AM', 'If you want to be a moderator, let NothinG know.');
INSERT INTO `moderation_forum_replies` VALUES ('8', '6', 'Evo', '7 April 2011 09:00 AM', 'Ryan, Josh, and Myself have been trying to tell the staff list that banning them is totally not fair, because we\'re basically banning them for using a different language, banning them for being themselves, this is discrimination... so it\'s good to see we\'re taking action now, and concluding the bans of the \'marginalised\'.');
INSERT INTO `moderation_forum_replies` VALUES ('10', '6', 'Zombie', '7 April 2011 07:52 PM', 'Trying to talk to martin to add :permban <username> so it will let us ban by IP in-game.');
INSERT INTO `moderation_forum_replies` VALUES ('15', '6', 'Evo', '8 April 2011 08:29 AM', 'That is a very good idea, however, I don\'t want to use it on the foreign guys.');
INSERT INTO `moderation_forum_replies` VALUES ('16', '6', 'Evo', '8 April 2011 08:31 AM', 'That is a very good idea, however, I don\'t want to use it on the foreign guys.');
INSERT INTO `moderation_forum_threads` VALUES ('4', 'Various', 'ARTICLE Comments:', '25 March 2011 09:42 PM', '99999999999', '~By NothinG~\r\n\r\nLink: http://pastebin.com/raw.php?i=NUkAFD1V\r\n\r\nHTML:\r\n\r\n<div id=\"disqus_thread\"></div>\r\n<script type=\"text/javascript\">\r\n    var disqus_shortname = \'habbovg\';\r\n	\r\n    /* * * DON\'T EDIT BELOW THIS LINE * * */\r\n    (function() {\r\n        var dsq = document.createElement(\'script\'); dsq.type = \'text/javascript\'; dsq.async = true;\r\n        dsq.src = \'http://\' + disqus_shortname + \'.disqus.com/embed.js\';\r\n        (document.getElementsByTagName(\'head\')[0] || document.getElementsByTagName(\'body\')[0]).appendChild(dsq);\r\n    })();\r\n</script>\r\n<noscript>Please enable JavaScript to view the <a href=\"http://disqus.com/?ref_noscript\">comments powered by Disqus.</a></noscript>', '1');
INSERT INTO `moderation_forum_threads` VALUES ('6', 'Zombie', 'Language Bans!', '7 April 2011 06:01 AM', '99999999999', 'Trying to make money for HabboVG, Josh doesn\'t want any more members banned for language. Now, the public rooms are allowed to roomkick & roomban members so we can make it seem like it\'s an English Only hostel. Just don\'t perm ban anyone.\r\nLet\'s try to get popular again.', '0');
INSERT INTO `moderation_presets` VALUES ('18', '1', 'message', 'You have scammed, so that will be a 2 Hours ban. When you come back, please make it stop, or a further timed ban will come. -Staff');
INSERT INTO `moderation_presets` VALUES ('19', '1', 'message', 'You have been cyber bullying, you will get a 2 Hours ban. When you come back, please make it stop. -Staff');
INSERT INTO `moderation_presets` VALUES ('20', '1', 'message', 'This specific feature(s)/furniture(s), as you have pointed out are on their way to Habbo.VG, the technical and coding team in Habbo are working on bringing this to Habbo.VG, please wait momentarily, this should take within 1-7 days, or up to a month. - Moderator/Admin on Duty.');
INSERT INTO `moderation_presets` VALUES ('22', '1', 'message', 'The Habbo.VG Staff Team is working on this problem. We are sorry for any inconvenience(s) this has caused. Please wait momentarily, - Moderators need to thoroughly deal with this properly. You should see changes being made soon. - Moderator/Staff on Duty.');
INSERT INTO `moderation_presets` VALUES ('23', '1', 'message', 'Your Call for Help has been processed and dealt with accordingly to the Habbo.VG Staff Code of Conduct, and the Moderation Team has taken your Call for help into consideration. This Call for Help has been recorded for confidential reasons. If this has not been dealt with to your satisfaction, please email us.');
INSERT INTO `moderation_presets` VALUES ('24', '1', 'message', 'You have been giving Personal Info / Phonenumbers / Adresses, so now you get a 2 Hour ban. If you keep doing this, we will ban even longer. -Staff');
INSERT INTO `moderation_presets` VALUES ('25', '1', 'message', 'If you have any technical problems, please email us at other.habbo.vg@gmail.com or alternatively contact a Staff online. -Staff');
INSERT INTO `moderation_presets` VALUES ('26', '1', 'message', 'The hourly credits are every 3 Hours. You get automatically 3.000c. For mroe Info, go on your Homepage -> Credits. -Staff');
INSERT INTO `moderation_presets` VALUES ('28', '1', 'message', 'Your behaviour/actions/language is highly inappropriate, and breaches the Habbo.VG Way, please comply with the Habbo.VG Way that we have distributed. You can view this by going to \'Community\' then, \'Habbo VG Way\', Please make the correct alternations so that punishments are not applied to you. - Hotel Management');
INSERT INTO `moderation_presets` VALUES ('29', '1', 'message', 'Your Call for Help does not meet the requirements made to be processed. Please caution that the Call for Help tool is only used for genuine reasons, and it is preferably not misused. - Habbo.VG Moderation Team');
